import './index.css';
import GuessInput from './components/GuessInput/components/GuessInput';
import Message from './components/Dispay/components/Message';

const Main = () => {
  return (
    <main>
      <section className="left">
        <GuessInput />
      </section>
      <section className="right"></section>
    </main>
  );
};

export default Main;
